import React from 'react';
import bivakzones from '../bivakzones.json';




export default function WcList(props) {
    console.log(bivakzones)
    const obj = [bivakzones];
    var bibi = JSON.parse(obj);
    const listBivakzones = bibi.map((bibi) =>
        <li>{bibi}</li>
    )


    return (
        <div>
            <ul>{listBivakzones}</ul>
        </div>
    )

}
